import React from "react";
import Category from "./Categories";

export default function SearchBarOptions() {
  return (
    <div className="options">
      <div className="options-main-category">
        <h2>Categories</h2>
        <div className="options-main-category-categories">
          <Category color="blue" icon="fa-solid fa-burger" name="Food" />
          <Category color="#ff5636" icon="fa-solid fa-burger" name="Culture" />
          <Category
            color="#FFCE32"
            icon="fa-solid fa-burger"
            name="Entertainment and recreation"
          />
        </div>
      </div>
    </div>
  );
}
